import { data } from 'jquery';
import React from 'react';
import { render } from 'react-dom';

class CountComponent extends React.Component{
    render(){
        const {data}= this.props
        return(
            <div>
              <p>Value :{data}</p>
            </div>

        )
    }

}
export default CountComponent;
